import imageGrid from "../../assets/Image-Grid2.png"

function Lounge(){
    return (
        <div className="lounge container section">
            <div className="sectionContainer grid">
                <div className="imgDiv">
                    <img src={ima} alt=""/>
                </div>
            </div>
        </div>
    )
}

export default Lounge;
